				\usepackage{amssymb}
				\usepackage{amsbsy}
				\usepackage{mathrsfs}
				\usepackage{upgreek}
				\setlength{\oddsidemargin}{-69pt}
				\begin{document}$$10^{6}$$\end{document} in comparison with those of a constant value Rs\documentclass[12pt]{minimal}
				\usepackage{amsmath}
				\usepackage{wasysym}
