In this paper, we proposed an electrical equivalent circuit model for OSCs where its accuracy is highly improved by considering a voltage-dependent series resistance. Using a proposed WRA for this model, the series resistance profile was extracted and compared with the results obtained by analytical equations at Vmp\documentclass[12pt]{minimal}
