				\begin{document}$$V_{oc}$$\end{document} and high applied voltages. The extracted results confirm reporting a single value Rs\documentclass[12pt]{minimal}
				\usepackage{amsmath}
				\usepackage{wasysym}
				\usepackage{amsfonts}
				\usepackage{amssymb}
				\usepackage{amsbsy}
				\usepackage{mathrsfs}
				\usepackage{upgreek}
				\setlength{\oddsidemargin}{-69pt}
				\begin{document}$$R_{s}$$\end{document} of OSC is not generally an accurate approach. Finally, the modified model was applied to measured J–V curves of five different cells, in which the active layers are processed using different materials and solvents. The solvent considerably influenced the active layer crystallinity and its charge carrier mobility, hence, the series resistance is largely affected. Moreover, a voltage dependent series resistance provides a good knowledge about the behavior of the OSC at different applied voltage regions. The proposed model can be used for better understanding the devices physics and to investigate the effects of different parameters including fabrication process parameters, geometry and morphology of the active layer on the cell electrical characteristics.

